let main = document.querySelector("main");

    
    const posts = [
      {
        image: 'data:image/jpeg;base64,',
        title: 'Abstract Art',
        post: 'This represent a mountain, climbing the high hills of struggle and reaching the peak of success.'
      },
      {
        image: 'data:image/jpeg;base64,',
        title: 'Geometric Art',
        post: 'This art represent the fusion of different shapes and diversity in unity.'
      },
      {
        image: 'data:image/jpeg;base64,',
        title: 'Realism Art',
        post: 'This art represent the beauty of human eye and the depth of vision.'
      }
    ];

    
    posts.forEach(function(post, index){
      main.insertAdjacentHTML('beforeend',
        `<article>
          <img src="${post.image}" alt="Art Image ${index + 1}">
          <h2>${post.title}</h2>
          <p>${post.post}</p>
        </article>
        `
      );
    });
